var searchBar=document.getElementById("vel-search"),searchDefault=searchBar.getAttribute("vel-search-default");switch(searchDefault.toLowerCase()){case"ask":setupSearch("https://www.ask.com/web?q=");break;case"bing":setupSearch("https://www.bing.com/search?q=");break;case"duckduckgo":setupSearch("https://duckduckgo.com/?q=");break;case"ecosia":setupSearch("https://www.ecosia.org/search?q=");break;case"google":setupSearch("https://www.google.com/search?q=");break;case"yahoo":setupSearch("https://search.yahoo.com/search?p=");break;case"yandex":setupSearch("https://yandex.com/search/?text=");break;default:unknownSearch()}function search(e){var a=document.getElementById("vel-search-1").value;for(i in a)a=String(a.replace(" ","+"));var r=String(e+a.replace(" ","+"));return location=String(r),!1}function setupSearch(e){searchBar.innerHTML="\n        <form onsubmit=\"return search('"+String(e)+'\');">\n            <input id="vel-search-1" type="text" name="vel-search" placeholder="Search for...">\n            <input type="submit" value="Search" name="button">\n        </form>\n    '}function unknownSearch(){searchBar.innerHTML="\n    <p>Velstart error: Unknown search engine, please check implementation!</p>\n    "}
